import React from "react";
import ResumeUpload from "../components/ResumeUpload";
import MatchScoreDisplay from "../components/MatchScoreDisplay";
import RecommendationsList from "../components/RecommendationsList";

export default function Dashboard() {
  return (
    <div style={{ padding: "20px", fontFamily: "Arial", maxWidth: "800px", margin: "0 auto" }}>
      <h1 style={{ textAlign: "center", marginBottom: "30px" }}>AI Enhancements</h1>

      {/* Resume / Bio Upload & Skill Extraction */}
      <section style={{ marginBottom: "40px", padding: "20px", border: "1px solid #ccc", borderRadius: "10px" }}>
        <h2>Resume / Bio Upload</h2>
        <ResumeUpload />
      </section>

      {/* Job ↔ Applicant Match Score */}
      <section style={{ marginBottom: "40px", padding: "20px", border: "1px solid #ccc", borderRadius: "10px" }}>
        <h2>Job ↔ Applicant Match Score</h2>
        <MatchScoreDisplay />
      </section>

      {/* Smart Job Recommendations */}
      <section style={{ marginBottom: "40px", padding: "20px", border: "1px solid #ccc", borderRadius: "10px" }}>
        <h2>Recommended Jobs</h2>
        <RecommendationsList />
      </section>
    </div>
  );
}
